const Tasks = (props) => {
  return (
    <div>
      {props.tasks.map((task) => {
        <li>
          <span>{task.title}</span>
          <span>{task.description}</span>
          <span>{task.dueDate}</span>
          <span>{task.type}</span>
        </li>;
      })}
    </div>
  );
};

export default Tasks;
